function convertToRoman(num) {
    var result = '';
    var roman = ["M", "CM", "D", "CD", "C", "XC", "L", "XL", "X", "IX", "V", "IV", "I"];
    var numeral = [1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1];

    for (var i=0; i<=numeral.length; i++){
        while(numeral[i] <= num){
            result += roman[i];
            num -= numeral[i];
            }
    }return result;
 return num;
}

